import { AppShell, Navbar, Header } from '@mantine/core';

const Layout = ({ children }) => {
  return (
    <AppShell
      navbar={<Navbar width={{ base: 300 }} height={500} p="xs">{/* Navbar content */}</Navbar>}
      header={<Header />}
    >
      {children}

    </AppShell>
  )
}

export default Layout;
